<template>
  <div>
    <div class="app-page-title">
      <div class="page-title-wrapper">
        <div class="page-title-heading">
          <div class="page-title-icon">
            <i class="pe-7s-id icon-gradient bg-mean-fruit"></i>
          </div>
          <div>
            Información del Usuario
            <div class="page-title-subheading opacity-10">
              <nav>
                <ol class="breadcrumb">
                  <li class="breadcrumb-item">
                    <a>
                      <i class="fa fa-home"></i>
                    </a>
                  </li>
                  <li class="breadcrumb-item">
                    <a>Perfil</a>
                  </li>
                </ol>
              </nav>
            </div>
          </div>
        </div>
        <div class="page-title-actions"></div>
      </div>
    </div>
    <ul class="body-tabs body-tabs-layout tabs-animated body-tabs-animated nav"></ul>
    <div class="tabs-animation">
      <template v-if="numPestaña==1">
        <div class="container">
          <div class="row justify-content-md-center">
            <div class="col-md-7">
              <div class="card-shadow-primary profile-responsive card-border mb-3 card">
                <div class="dropdown-menu-header">
                  <div class="dropdown-menu-header-inner bg-focus">
                    <div
                      style="background-image: url('data:image/jpeg;base64,')"
                      class="menu-header-image opacity-3"
                    ></div>
                    <div class="menu-header-content btn-pane-right">
                      <div class="avatar-icon-wrapper mr-2 avatar-icon-xl">
                        <div class="avatar-icon rounded">
                          <img :src="auth.avatarPublico" alt="Avatar" />
                        </div>
                      </div>
                      <div>
                        <h5 class="menu-header-title">{{auth.name}}</h5>
                      </div>
                    </div>
                  </div>
                </div>
                <ul class="list-group list-group-flush">
                  <li class="list-group-item">
                    <div class="widget-content">
                      <div class="text-center">
                        <h5 class="widget-heading opacity-2"></h5>
                        <h5>
                          <div class="row">
                            <div class="col-md-12">
                              <span class="float-left">
                                <b>Rol de Usuario:</b>
                                <template v-if="getRoles!=''">{{getRolById(auth.rol_id).nombre}}</template>
                              </span>
                            </div>
                          </div>
                          <div class="row">
                            <div class="col-md-12">
                              <span class="float-left">
                                <b>Email:</b>
                                {{auth.email}}
                              </span>
                            </div>
                          </div>
                        </h5>
                      </div>
                    </div>
                  </li>
                  <li class="p-0 list-group-item">
                    <div class="grid-menu grid-menu-3col">
                      <div class="no-gutters row">
                        <div class="col-sm-4">
                          <button
                            class="btn-icon-vertical btn-square btn-transition btn btn-outline-link"
                            @click="showModal('nombre')"
                          >
                            <i class="lnr-pencil btn-icon-wrapper btn-icon-lg mb-3"></i>Cambiar Nombre
                          </button>
                        </div>
                        <div class="col-sm-4">
                          <button
                            class="btn-icon-vertical btn-square btn-transition btn btn-outline-link"
                            @click="showModal('imagen')"
                          >
                            <i class="lnr-link btn-icon-wrapper btn-icon-lg mb-3"></i>Cambiar Imagen
                          </button>
                        </div>
                        <div class="col-sm-4">
                          <button
                            class="btn-icon-vertical btn-square btn-transition btn btn-outline-link"
                            @click="showModal('contraseña')"
                          >
                            <i class="lnr-star btn-icon-wrapper btn-icon-lg mb-3"></i>Cambiar Contraseña
                          </button>
                        </div>
                      </div>
                    </div>
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </template>
      <template v-else>
        <div class="container">
          <div class="main-card mb-3 card">
            <div class="card-body">
              <div class="row justify-content-center">
                <div class="col-md-8">
                  <div
                    class="alert alert-danger mt-4 text-center"
                    role="alert"
                  >Ya has ingresado desde otra pestaña del navegador!!</div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </template>
    </div>
    <modal name="cambiarImagen" classes="my_modal" :width="700" :height="485">
      <div class="modal-content">
        <div class="modal-header">
          <h5 class="modal-title" id="exampleModalLongTitle">{{titulo}}</h5>
          <button type="button" class="close" @click="$modal.hide('cambiarImagen')">
            <span aria-hidden="true">&times;</span>
          </button>
        </div>
        <div class="modal-body">
          <template v-if="tipo==='imagen'">
            <div class="container">
              <div class="row">
                <div class="col-md-6">
                  <div class="position-relative form-group">
                    <label for="imagen" class>Imagen</label>
                    <input
                      name="imagen"
                      @change="obtenerImagen"
                      id="imagen"
                      accept="image/jpeg"
                      type="file"
                      :class="['form-control-file', $v.imagen.$error!=''? 'error-input-select':'']"
                      ref="inputImagen"
                    />
                    <em v-if="errorImagen" class="text-error-input">{{errorImagen}}</em>
                    <em
                      v-if="$v.imagen.$error&&!$v.imagen.required"
                      class="text-error-input"
                    >{{mensajes.required}}</em>
                  </div>
                </div>
                <div class="col-md-6">
                  <template v-if="mostraImagen">
                    <Croppie
                      :id="'croppie'"
                      :imagen="mostraImagen"
                      @cambiarValorImagen="cambiarValorImagen"
                      :mostrarBtnCroppie="true"
                      :zoom="1"
                      :enableZoom="true"
                      :editar="false"
                      :boundaryHeigth="230"
                      :viewportWidth="200"
                    />
                  </template>
                  <template v-else>
                    <div class="text-center">
                      <h5 class="mt-5 mb-5">
                        <span class="pr-1">
                          <b class="text-warning">SIN IMAGEN</b>
                        </span>
                      </h5>
                    </div>
                  </template>
                </div>
              </div>
            </div>
          </template>
        </div>
        <div class="modal-footer">
          <button
            type="button"
            class="btn btn-secondary"
            @click="$modal.hide('cambiarImagen')"
          >Cancelar</button>
          <button
            type="button"
            class="btn btn-success"
            @click="eventBtn"
            :disabled="bloquearBtnModal"
          >Cambiar</button>
        </div>
      </div>
    </modal>
    <modal name="cambiarInfo" classes="my_modal" :width="450" :height="450">
      <div class="modal-content">
        <div class="modal-header">
          <h5 class="modal-title" id="exampleModalLongTitle">{{titulo}}</h5>
          <button type="button" class="close" @click="$modal.hide('cambiarInfo')">
            <span aria-hidden="true">&times;</span>
          </button>
        </div>
        <div class="modal-body">
          <template v-if="tipo==='nombre'">
            <div class="position-relative form-group">
              <label for="nombre" class>Nombre</label>
              <input
                name="nombre"
                id="nombre"
                placeholder="..."
                type="text"
                :class="['form-control', $v.nombre.$error? 'error-input-select':'']"
                v-model.trim="$v.nombre.$model"
              />
              <em
                v-if="$v.nombre.$error&&!$v.nombre.required"
                class="text-error-input"
              >{{mensajes.required}}</em>
              <em
                v-if="$v.nombre.$error&&!$v.nombre.alpha"
                class="text-error-input"
              >{{mensajes.alpha}}</em>
            </div>
          </template>
          <template v-if="tipo==='contraseña'">
            <label for="pass" class>Contraseña</label>
            <div class="input-group mb-3">
              <input
                name="pass"
                id="pass"
                placeholder="..."
                :type="showPass==true?'text':'password'"
                :class="['form-control', $v.pass.$error? 'error-input-select':'']"
                v-model.trim="$v.pass.$model"
              />
              <div class="input-group-append verContraseña">
                <span class="input-group-text">
                  <i class="fas fa-eye" v-if="showPass" @click="showPass=!showPass"></i>
                  <i class="fas fa-eye-slash" v-else @click="showPass=!showPass"></i>
                </span>
              </div>
              <em
                v-if="$v.pass.$error&&!$v.pass.required"
                class="text-error-input"
              >{{mensajes.required}}</em>
              <em
                v-if="$v.pass.$error&&!$v.pass.minLength"
                class="text-error-input"
              >{{mensajes.minLength}}</em>
              <em
                v-if="$v.pass.$error&&!$v.pass.maxLength"
                class="text-error-input"
              >{{mensajes.maxLength}}</em>
            </div>
            <label for="pass1" class>Confirmar Contraseña</label>
            <div class="input-group mb-3">
              <input
                name="pass1"
                id="pass1"
                placeholder="..."
                :type="showPass1==true?'text':'password'"
                :class="['form-control', $v.pass1.$error? 'error-input-select':'']"
                v-model.trim="$v.pass1.$model"
              />
              <div class="input-group-append verContraseña">
                <span class="input-group-text">
                  <i class="fas fa-eye" v-if="showPass1" @click="showPass1=!showPass1"></i>
                  <i class="fas fa-eye-slash" v-else @click="showPass1=!showPass1"></i>
                </span>
              </div>
              <em
                v-if="$v.pass1.$error&&!$v.pass1.required"
                class="text-error-input"
              >{{mensajes.required}}</em>
              <em
                v-if="$v.pass1.$error&&!$v.pass1.sameAs"
                class="text-error-input"
              >{{mensajes.sameAs}}</em>
            </div>
          </template>
        </div>
        <div class="modal-footer">
          <button
            type="button"
            class="btn btn-secondary"
            @click="$modal.hide('cambiarInfo')"
          >Cancelar</button>
          <button
            type="button"
            class="btn btn-success"
            @click="eventBtn"
            :disabled="bloquearBtnModal"
          >Cambiar</button>
        </div>
      </div>
    </modal>
  </div>
</template>

<script>
import bloquearPestañasMixin from "../mixins/bloquearPestañas";
import Toastr from "../mixins/toastr";
import vuex from "vuex";
import Croppie from "./CroppieComponent.vue";

const ruleAlpha = /^[A-Za-z\sÁÉÍÓÚáéíóúñÑüÜ]+$/;
import {
  required,
  sameAs,
  minLength,
  maxLength,
} from "vuelidate/lib/validators";
export default {
  components: {
    Croppie,
  },
  data() {
    return {
      showPass: false,
      showPass1: false,
      titulo: "",
      tipo: "",
      nombre: "",
      imagen: "",
      pass: "",
      pass1: "",
      errorImagen: "",
      errorPass: "",
      errorNombre: "",
      imagenMiniatura: "",
      bloquearBtnModal: false,
      mensajes: {
        required: "El campo es requerido.",
        sameAs: "Las contraseñas no coinciden",
        alpha: "El campo solo puede contener letras.",
        minLength: "La contraseña debe tener mínimo 8 carácteres.",
        maxLength: "La contraseña debe tener máximo 15 carácteres.",
      },
    };
  },
  validations() {
    if (this.tipo == "nombre") {
      return {
        nombre: {
          required,
          alpha(value) {
            if (value == "") return true;
            if (!ruleAlpha.test(value)) return false;
            return true;
          },
        },
      };
    } else if (this.tipo == "imagen") {
      return { imagen: { required } };
    } else {
      return {
        pass: {
          required,
          minLength: minLength(8),
          maxLength: maxLength(15),
        },
        pass1: {
          required,
          sameAs: sameAs("pass"),
        },
      };
    }
  },
  mixins: [bloquearPestañasMixin("perfil"), Toastr],
  methods: {
    ...vuex.mapActions(["accionModificarAuth"]),
    cambiarValorImagen(valor) {
      this.imagen = valor;
    },
    showModal(tipo) {
      this.nombre = "";
      this.pass = "";
      this.imagen = "";
      this.tipo = tipo;
      switch (tipo) {
        case "nombre":
          this.titulo = "Cambiar Nombre";
          this.nombre = this.auth.name;
          this.$modal.show("cambiarInfo");
          break;
        case "imagen":
          this.titulo = "Cambiar Imagen";
          this.$modal.show("cambiarImagen");
          break;
        case "contraseña":
          this.titulo = "Cambiar Contraseña";
          this.$modal.show("cambiarInfo");
          break;
      }
    },
    obtenerImagen(e) {
      let file = e.target.files[0];
      let allowedExtensions = /(.jpg|.jpeg|.png)$/i;
      if (file) {
        if (!allowedExtensions.exec(file.name) || file.size > 2000000) {
          this.errorImagen =
            "La imagen debe ser en formato .png .jpg y menor a 2Mb.";
          this.$refs.inputImagen.value = "";
          this.imagen = "";
        } else {
          this.errorImagen = "";
          this.cargarImagen(file);
        }
      } else {
        this.imagen = "";
        this.imagenMiniatura = "";
      }
    },
    cargarImagen(file) {
      let reader = new Image();
      reader.onload = (e) => {
        this.imagenMiniatura = reader.src;
      };
      reader.src = URL.createObjectURL(file);
    },
    eventBtn() {
      this.bloquearBtnModal = true;
      let parametros = {
        nombre: this.nombre,
        pass: this.pass,
        imagen: this.imagen,
      };
      switch (this.tipo) {
        case "nombre":
          this.$v.nombre.$touch();
          if (!this.$v.$invalid) {
            axios
              .put(`/perfil/cambiar-${this.tipo}`, parametros)
              .then((res) => {
                this.bloquearBtnModal = false;
                this.accionModificarAuth(res.data);
                this.toastr(
                  this.titulo,
                  "Accion realizada con exito!!",
                  "success"
                );
                this.$modal.hide("cambiarInfo");
              })
              .catch((error) => {
                if (
                  error.response.status === 405 ||
                  error.response.status === 401
                ) {
                  window.location.href = "/";
                } else {
                  this.bloquearBtnModal = false;
                }
              });
          } else {
            this.bloquearBtnModal = false;
            this.toastr(
              "Error!!",
              "Favor llenar correctamente los campos",
              "error"
            );
          }
          break;
        case "imagen":
          this.$v.imagen.$touch();
          if (!this.$v.$invalid) {
            axios
              .put(`/perfil/cambiar-${this.tipo}`, parametros)
              .then((res) => {
                this.bloquearBtnModal = false;
                this.accionModificarAuth(res.data);
                this.toastr(
                  this.titulo,
                  "Accion realizada con exito!!",
                  "success"
                );
                this.$modal.hide("cambiarImagen");
              })
              .catch((error) => {
                if (
                  error.response.status === 405 ||
                  error.response.status === 401
                ) {
                  window.location.href = "/";
                } else {
                  this.bloquearBtnModal = false;
                }
              });
          } else {
            this.bloquearBtnModal = false;
            this.toastr(
              "Error!!",
              "Favor llenar correctamente los campos",
              "error"
            );
          }
          break;
        case "contraseña":
          this.$v.pass.$touch();
          this.$v.pass1.$touch();
          if (!this.$v.$invalid) {
            axios
              .put(`/perfil/cambiar-${this.tipo}`, parametros)
              .then((res) => {
                this.bloquearBtnModal = false;
                this.accionModificarAuth(res.data);
                this.toastr(
                  this.titulo,
                  "Accion realizada con exito!!",
                  "success"
                );
                this.$modal.hide("cambiarInfo");
              })
              .catch((error) => {
                if (
                  error.response.status === 405 ||
                  error.response.status === 401
                ) {
                  window.location.href = "/";
                } else {
                  this.bloquearBtnModal = false;
                }
              });
          } else {
            this.bloquearBtnModal = false;
            this.toastr(
              "Error!!",
              "Favor llenar correctamente los campos",
              "error"
            );
          }
          break;
      }
    },
  },
  computed: {
    ...vuex.mapGetters("usuarios", ["getRolById", "getRoles"]),
    ...vuex.mapState(["auth"]),
    mostraImagen() {
      return this.imagenMiniatura;
    },
  },
  created() {
    this.$emit("rutaSider", window.location.pathname);
  },
};
</script>